{
    Card,
    CardBody,
    CardTitle,
    CardSubtitle,
    Container,
    Button,
    Col
}
 from 'reactstrap'

// style={{"width": "50rem"}}

function Blog({blog,history}) {

    const authors = get

    return (
        <div className="m-2">
          <Card className="mycard" body color="primary" outline>
            <CardBody className="text-center">
              <CardTitle className="card-title">Blog</CardTitle>
              <CardSubtitle>
              {
                blog.content===null?
                "No Content":
                blog.content
              }
            </CardSubtitle>
            <Button color='warning'>Update</Button>
            <Button color='danger' className='m-3'>Delete</Button>
          </CardBody>
        </Card>
      </div>
    );

}

export default Blog;
